import React, {Component} from 'react';
import {Link} from 'react-router-dom';

import image from '../../../public/images/bg/1.jpge';

import Header from '../Common/Header';

class Home extends Component {
    render(){
        return(
			<Header
				title1="Tue minh"
				title2="bookstore"
				showButton= {true}
				image={image}
			/>
        )
    }
}

export default Home;
